import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

ReactDOM.render(
    <App />,
  document.getElementById('root')
);



$(document).ready(function(){

  $('#barSlider').change(()=>{
      let val=$("#barContainer").width();
      $("#barContainer").css({'left': "50%-"+val})

  })

});
